import React from 'react';

const CreateNote = () => {
	return (
		<div className="create-note">
			<h2>Create Note</h2>
			<form>
				<div className="row">
					<label htmlFor="title">Title</label>
					<input type="text" name="title" />
				</div>
			</form>
		</div>
	);
};

export default CreateNote;
